window.bookSummaryJSON = "<p>From <i>USA Today</i> best-selling author Brett Battles comes the latest in his award winning Jonathan Quinn thriller series. </p> <p>The unthinkable has happened. A life has been extinguished - one belonging to someone Jonathan Quinn and his partner Nate care about more than almost anyone else in the world. </p> <p>Those responsible will pay. </p> <p>No matter how long it takes, no matter how far and wide the search, Quinn, Nate, and their colleagues will stop at nothing to exact the appropriate justice. </p> <p>Because if there is one thing those in the shadow world should know, you do not mess with Quinn's people. </p>"; 
